# Maximum of array
# Very common operation on sequence of values, or arrays is to find its
# extremal value - maximum or minimum. To achieve this one need to store current
# maximum (or minimum respectively) in a separate variable, and then run through
# array, comparing each of its elements to this variable. Whenever next value is
# greater than this temporary variable, this value should be copied into it (as
# a new maximum).
# At the end of the pass this temporary variable will hold the extremum value.
# Input data: will give you exactly 300 numbers in a single line.
# Answer should contain maximum and minimum of these values, separated by space.
values = '60147 -59115 -4293 64614 38737 -64681 -74786 -69232 19393 17880 -42641 -73939 -20040 -26077 69193 38769 61626 29584 67144 60850 28655 76286 -16367 50469 -74115 75408 57366 75130 9397 -72881 5459 -10456 -51996 -78833 -25841 66740 -63514 -20627 77508 35879 77252 -45133 41939 -22788 8790 31132 -64018 -9584 -19283 -76873 -28733 -70627 79413 34899 59841 -74702 30308 37207 -79571 -40295 44326 5888 29248 72329 7054 -76593 59070 23539 -17220 56578 -20582 -19968 -68554 -58642 37244 20235 52490 53226 -69348 -46793 56352 -18082 -37421 55766 -63182 -57580 61064 47126 59627 61492 -73169 23954 -12619 36079 16283 74434 39486 -4647 17974 -57734 -28069 77392 2298 -16623 -61250 -40458 -76388 71239 -67232 -65736 -55553 69120 -3818 -12974 44886 13000 9446 25950 -19874 -10927 7443 -13043 -66973 74823 -56964 29310 69257 62521 -55336 7232 -75212 -3405 4625 7085 59971 23374 46626 63583 14614 59393 77846 39061 48514 -5971 -53913 13400 -72971 35532 -40649 -12845 -55394 46793 54111 -42367 41616 77146 66943 30874 59668 -68392 -41893 64455 8202 42731 -8460 -11826 -13894 -41833 -28243 -79280 -62439 -30396 39780 66074 43632 65867 -526 50660 21400 38824 -42185 46006 5618 -68073 -76360 -32766 -70927 70582 78108 68740 -77810 -43785 53196 10392 78945 -35263 78565 -14949 2903 -29678 -14229 20463 19925 -54448 6537 -16442 -68581 -73988 -45782 32819 44836 -7967 -1175 -29546 3959 2465 17688 13032 -6953 15796 1773 -4763 52010 -25031 -74371 50956 19705 -75806 -43992 -57391 -25484 21778 43071 74441 47329 -30391 -22001 58748 -24379 12217 11568 -59543 -75749 -69606 -9090 8210 12858 -71402 -58758 -74095 24394 23015 1142 -3596 77984 6770 -32639 17689 10964 3368 40298 65480 -54853 3369 59921 72475 52978 -42080 51224 -51401 50137 -17207 -30945 54387 -6814 39965 -17402 -73956 48563 3840 -68051 -7043 -53145 13090 69361 -55161 -60139 -43278 42528 30825 40090 2826 16305 65236 -73804 -3774 57712 59173 34146 28936'
values_list = values.split(' ')
max_value = 0
min_value = 0
int_list = []
for value in values_list:
    int_list += [int(value)]
for num in int_list:
    if max_value < num:
        max_value = num
    elif min_value > num:
        min_value = num
print(max_value, min_value)